import gql from 'graphql-tag';

const ALL_PRODUCTS_QUERY = gql`
query ALL_PRODUCTS_QUERY {
    allProducts {
        id
        name
        price
        description
        photo {
            id
            image {
                publicUrlTransformed
            }
        }
    }
}
`;

export default function Products() {
    return (
        <div>
            <p>Productos</p>
        </div>
    )
};
